  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This page includes results from CMSs
  Past Performance Review. The report called Spring 2014 Past Performance Review Outlier
  Results lists MA organizations and Part D sponsors identified as poor performing
  or outlier organizations during the period from January 2013 through February 2014.
  The report lists the name of the organization, whether its performance problems
  were related to Part C, Part D, or both, and the performance categories in which
  the entity scored poorly. The detailed methodology that CMS used to identify these
  poor performers is available as well as the Contract Year 2013 Annual Election Period
  Marketing Surveillance Summary Report.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
